import HeaderContact from "./HeaderContact" ;



import Nav from "./Nav.js" ;

function App() {
  return (
    <div className="App">

     <div className="Header__container">

       <div className="header__contact">
          <HeaderContact/>
       </div>

       <Nav/>

     </div>


    </div>
  );
}

export default App;
